	add("printshop", "{\"term\":\"printshop\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|print|shop|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A shop where one can buy prints; a printseller\u0027s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003dForeword|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dHe stood transfixed before the unaccustomed view of London at night time, a vast panorama which reminded him [\u0026amp;hellip;] of some wood engravings far off and magical, in a \u0027\u0027printshop\u0027\u0027 in his childhood\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; A shop offering commercial printing services; a printery or printing house\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, p. 263\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As we have seen, government regulated the number of \u0027\u0027printshops\u0027\u0027 throughout the realm [...] and enforced censorship throughout the land\", \"priority\":5}]}, \"synonyms\":{}}");

