	add("prioritarianism", "{\"term\":\"prioritarianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The view that the goodness of an outcome is a function of overall well-being across all individuals, with extra weight given to those who are worse off\", \"priority\":1}]}, \"synonyms\":{}}");

	add("priority", "{\"term\":\"priority\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027priorite\u0027 from Latin \u0027prioritas\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An item\u0027s relative importance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He set his e-mail message\u0027s \u0027\u0027priority\u0027\u0027 to high\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A goal of a person or an organisation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"She needs to get her \u0027\u0027priorities\u0027\u0027 straight and stop playing games\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A superior claim to use by virtue of being validly published at an earlier date\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Neither [Jones] nor I (in 1966) could conceive of reducing our \u0026quot;science\u0026quot; to the ultimate absurdity of reading Finnish newspapers almost a century and a half old in order to establish \u0026quot;\u0027\u0027priority\u0027\u0027.\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Precedence; superior rank\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1608\u0027\u0027, w: William William Shakespeare, \u0027s: The Tragedy of The Tragedy of Coriolanus\u0027, I. i. 244\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Follow Cominius. We must follow you. / Right worthy you priority\", \"priority\":9}]}, \"synonyms\":{}}");

