	add("prism", "{\"term\":\"prism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"\u0027prisma\u0027 from Ancient greek (to 1453) \u0027πρίσμα\u0027 (something sawed) from \u0027πρίζειν\u0027 (to saw)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A polyhedron with parallel ends of the same size and shape, the other faces being parallelogram-shaped sides\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A transparent block in the shape of a prism (typically with triangular ends), used to split or reflect light\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A crystal in which the faces are parallel to the vertical axis\", \"priority\":3}]}, \"synonyms\":{}}");

	add("priss", "{\"term\":\"priss\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{back-form|prissy|nodot\u003d1|lang\u003den}} (analyzed as \u0027\u0027priss\u0027\u0027 + \u0027-y\u0027 ((manner)) , noun attested 1923.\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A prissy person\", \"priority\":1}]}, \"synonyms\":{}}");

	add("priscilla", "{\"term\":\"priscilla\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Feminine diminutive form of a Roman cognomen Priscus, Latin \u0026quot;ancient\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"of biblical origin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1858\u0027\u0027 Henry Wadswoth Longfellow: \u0027The Courtship of Miles Standish\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Letters written by Alden, and full of the name of \u0027\u0027Priscilla\u0027\u0027, / Full of the name and the fame of the Puritan maiden \u0027\u0027Priscilla\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027 Minette Walters: \u0027Disordered Minds\u0027: Macmillan. ISBN 1741142121 p.354\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Priscilla,\u0027 she said, --- \u0027The same name I\u0027ve had for twenty years!\u0027 She smiled cynically. \u0027And, before you ask why, I was stoned when I chose it, so any thoughts of Cill were in my subconscious. I used to think it was classier than Louise or Daisy... probably because the Trevelyans were such snobs\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An early Christian, mentioned in the Bible and also known as Prisca\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"And found a certain Jew named Aquila, born in Pontus, lately come from Italy, with his wife \u0027\u0027Priscilla\u0027\u0027; (because that Claudius had commanded all Jews to depart from Rome:) and came unto them\", \"priority\":7}]}, \"synonyms\":{}}");

	add("priscillianist", "{\"term\":\"priscillianist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Priscillian|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A follower of Priscillian, bishop of Avila in Spain in the fourth century, who mixed various elements of Gnosticism and Manichaeism with Christianity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prison", "{\"term\":\"prison\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027prison\u0027 from Latin \u0027prehensiōnem\u0027 accusative singular of \u0027prehensiō\u0027 from the verb \u0027prehendō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A place or institution of confinement, especially of long-term confinement for those convicted of serious crimes or otherwise considered undesirable by the government\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The cold stone walls of the \u0027\u0027prison\u0027\u0027 had stood for over a century\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Confinement in prison\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Prison\u0027\u0027 was a harrowing experience for him\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any restrictive environment, such as a harsh academy or home\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The academy was a \u0027\u0027prison\u0027\u0027 for many of its students because of its strict teachers\", \"priority\":6}]}, \"synonyms\":{}}");

	add("prisoner", "{\"term\":\"prisoner\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027prisonier\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person incarcerated in a prison, while on trial or serving a sentence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any person held against their will\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Captain Edward Carlisle, soldier as he was, martinet as he was, felt a curious sensation of helplessness seize upon him as he met her steady gaze, her alluring smile ; he could not tell what this \u0027\u0027prisoner\u0027\u0027 might do\", \"priority\":3}]}, \"synonyms\":{}}");

	add("privacy", "{\"term\":\"privacy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Dutch\"], \"text\":\"From English\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being private; the state of not being seen by others\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Carried somehow, somewhither, for some reason, on these surging floods, were these travelers,. Even such a boat as the \u0027Mount Vernon\u0027 offered a total deck space so cramped as to leave secrecy or \u0027\u0027privacy\u0027\u0027 well out of the question, even had the motley and democratic assemblage of passengers been disposed to accord either\", \"priority\":2}]}, \"synonyms\":{}}");

	add("privateer", "{\"term\":\"privateer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|private|eer|lang\u003den}}, on the model of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unethical individual or group acting covertly with enabling, usually bribed, accomplices inside government to destroy a government’s ability to carry out some aspect of its moral mission of protection and empowerment, by transferring critical moral functions along with public funds. Privateers make considerable profits for doing these civic tasks without any public accountability. Examples include: military functions; intelligence functions; monitoring food, drug, and product safety; interrogating prisoners; disaster relief; and educating the public\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A privately owned warship that had official sanction to attack enemy ships and take possession of their cargo\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An officer or any other member of the crew of such a ship\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Kidd soon threw off the character of a \u0027\u0027privateer\u0027\u0027 and became a pirate\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A private individual entrant into a race or competition who does not have the backing of a large, professional team\", \"priority\":6}]}, \"synonyms\":{}}");

	add("privateness", "{\"term\":\"privateness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|private|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being private\", \"priority\":1}]}, \"synonyms\":{}}");

	add("privation", "{\"term\":\"privation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027privacion\u0027 from Latin \u0027prīvātiō\u0027 compare French \u0027privation\u0027 See \u0027private\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being deprived of or lacking an attribute formerly or properly possessed; the loss or absence of such an attribute\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being very poor, and lacking the basic necessities of life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of depriving someone of such basic necessities; deprivation\", \"priority\":3}]}, \"synonyms\":{}}");

	add("privilege", "{\"term\":\"privilege\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"From Latin {{m|la|prīvilēgium||ordinance or law against or in favor of an individual}}, probably from {{m|la|prīvus||private}} + {{m|la|lex|lēx, lēg-|law}}. Later reinforced or reborrowed from Anglo-norman {{m|fro|privilege}}, from Latin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An exemption from certain laws granted by the Pope\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A particular benefit, advantage, or favor; a right or immunity enjoyed by some but not others; a prerogative, preferential treatment\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"All first-year professors here must teach four courses a term, yet you\u0027re only teaching one! What entitled you to such a \u0027\u0027privilege\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An especially rare or fortunate opportunity; the good fortune (to do something\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, \u0027The Observer\u0027, letter, 29 April\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I had the \u0027\u0027privilege\u0027\u0027 to sit near him in the House for a small part of his Commons service and there was an additional device provided to aid his participation in debates\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The fact of being privileged; the status or existence of (now especially social or economic) benefit or advantage within a given society\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"c. 1390\u0027\u0027, \u0027Melibeus\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"He is worthy to lesen his \u0027\u0027priuilege\u0027\u0027 that mysvseth the myght and the power that is yeuen hym\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1938\u0027\u0027, \u0027Homage to Catalonia\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"In that community where no one was on the make, where there was a shortage of everything but no \u0027\u0027privilege\u0027\u0027 and no boot-licking, one got, perhaps, a crude forecast of what the opening stages of Socialism might be like\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, \u0027The Guardian\u0027, 21 Oct, (headline\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"South Africa\u0027s \u0027miracle transition\u0027 has not put an end to white \u0027\u0027privilege\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A right or immunity enjoyed by a legislative body or its members\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, \u0027The Guardian\u0027, leader, 1 May\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Dr Grigori Loutchansky is – according to a congressman speaking under congressional \u0027\u0027privilege\u0027\u0027 – a \u0026quot;purported Russian mob figure\u0026quot\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A stock market option\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A common law doctrine that protects certain communications from being used as evidence in court\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Your honor, my client is not required to answer that; her response is protected by attorney-client \u0027\u0027privilege\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"An ability to perform an action on the system that can be selectively granted or denied to users; permission\", \"priority\":20}]}, \"synonyms\":{}}");

